		{
			"_addr": "23AA6428",
			"current_frame": "normal",
			"custom": "yes",
			"face_right": 0,
			"label": "berd",
			"on_start_level": "if(level.player.vars.stored_events['berd_speech_bon_bosque'], remove_object(me))",
			"on_talk": "[set(level.zoom, 2),
	          speech_dialog(me, [~Well, you made it!~],
	          					[~Now just up ahead there is a gate.\\nIf you can get through it,\\nyou'll make it to the limestone caverns.\\nThere is said to be a way into the\\nbasement floors of Milgram's compound,\\nsomewhere in the caverns.~],
	          					[~If you wanted a personal audience,\\nsneaking in is probably the best bet.\\nI doubt the entrance guards\\nwould give you the time of day.~],
                 set(level.player.animation, 'emote_geez'),
	             level.player,	[~Yeah... geez though.  Caves, now?\\nAre these caves long?~],
				           me,	[~I'm afraid so.~],
                 set(level.player.animation, 'emote_confused'),
	             level.player,	[~Ugh.\\nNo sense in turning back now, though.~],
			               me,	[~Are you really certain you want to do this?\\nI'm afraid I can't follow you into the caverns,\\nso this is the last you would see of me.~],
                 set(level.player.animation, 'emote_nod'),
				 level.player,	[~Yes, I am; I'd be twice the fool,\\nto come this far and just give up.~],
                 set(level.player.animation, 'emote_raisedfinger'),
				 				[~Nevertheless,\\nthank you very much for all your help!~],
				 		   me,	[~You're welcome, but it's a tad premature...\\nI have something for you which I hope will help.~],
                 set(level.player.animation, 'emote_confused'),
				 level.player,	[~Oh?~],
						   me,	[~Yes, I've pulled a few strings,\\ncalled in a few favors and whatnot...~],
						   		[~...and got my hands on a Force Talisman.\\nFor your use.~],
						   		[~I'm not exactly sure what it will do, but\\nI'm told it has somewhat of a mind of its own.~],
                 set(level.player.animation, 'emote_confused'),
				 level.player,	[~I'm not sure I understand...~],
						   me,	[~Nor do I -\\nthat's simply what I was told.~],
						   		[~Nevertheless, you can probably\\nfigure that out simply by trying it.~],
				       			[~I wish you the best,\\nand I hope that helps keep you safe!~],
                 set(level.player.animation, 'emote_nod'),
				 level.player,	[~Absolutely!\\nThanks again!~],
							 spawn('ability',level.player.mid_x,level.player.y-200,1, [set(child.kind,'homingshot'),fire_event(child,'acquired')])
				 ),
				set(facing, -1),
				set(animation, 'fly_up'),
				set(level.zoom, 1)]",
